import React, { Component } from 'react';
import NavBar from '../src/components/functional/NavBar'
import Cities from '../src/components/containers/Cities'
import SignInPage from '../src/components/containers/SignInPage'
import LandingPage from '../src/components/containers/LandingPage'
import { BrowserRouter, Route } from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div className="container">
          <NavBar />
          <Route path='/home' component={LandingPage} />
          <Route path='/cities' component={Cities} />
          <Route path='/signin' component={SignInPage} />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
